  [],\n\t\"revision_timestamp\": \"2014-09-17T18:38:00.027576\",\n\t\"name\": \"road-and-street-centerlines-mo-2004-modot-roads-shp\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The MoDOT roadway coverage is based on
  a Dynamic Segmentation model. Dynamic Segmentation models linear features using
  routes and events, associating multiple sets of attributes to any portion of a linear
  feature. The ARC feature class forms the basic linear infrastructure from which
  Dynamic Segmentation models or route-systems are built. NODES indicate the endpoints
  and intersections of ARCS. The 'from-node' is the first vertex of the arc; the 'to-node'
  is the last vertex. Together, they define the direction of the arc. Arc-node topology
  defines connectivity of Dynamic Segmentation models or route-systems. Route systems
  are built without modifying the underlying arc-node topology. A route represents
  a single linear feature, such as a city street or highway. Routes are linear features
  composed of one or more arcs or parts of an arc; for example, a highway may be composed
  of a number of connected arcs. A route, for Dynamic Segmentation purposes, is simply
  a linear feature with measure values attached to it. Each route is associated with
  a measurement system, a linear method consisting of a starting value and other measures
  along the route, which describe distance along them. The measures are used to locate
  data that describe parts of the route. Data along routes is modeled using events.
  Event data, such as accidents, signs, functional classification, pavement condition,
  pavement type, is based on the Dynamic Segmentation model, the foundation of which
  is the route system. The state system network (IS, US, MO, RT) originated from 1980-DIME
  data, which was later updated with 1995 TIGER files from the US Census Bureau. Currently
  the coverage is updated monthly utilizing design plans, GPS, aerial imagery and
  county/city maps. All Census related fields have been removed, as they are not utilized
  nor updated by MoDOT.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
